operations.content:
query Alldrugs {
  backend_drugs {
    data {
      id
      attributes {
        title
      }
    }
  }
}

mutation Login($identifier: String!, $password: String!) {
  backend_login(input: {identifier: $identifier, password: $password}) {
    jwt
    user {
      id
      username
      email
    }
  }
}

mutation NewDrug {
  backend_createDrug(data: {title: "tutu"}) {
    data {
      id
      attributes {
        title
      }
    }
  }
}
